#define	SCOPE_TYPE(scope)   psmsfsLexer_##scope##_SCOPE
#define SCOPE_STACK(scope)  psmsfsLexer_##scope##Stack
#define	SCOPE_TOP(scope)    ctx->psmsfsLexer_##scope##Top
#define	SCOPE_SIZE(scope)		ctx->psmsfsLexer_##scope##Stack_limit
#define SCOPE_INSTANCE(scope, i)	(ctx->SCOPE_STACK(scope)->get(ctx->SCOPE_STACK(scope),i))

 
